import './App.css';
import { BrowserRouter , Routes, Route } from 'react-router-dom';
import { Sidebar } from './components/Sidebar';

function App() {
  return (
    <>
      <Router>
        <Sidebar />
        <Routes>
          <Route path='/' exact component={Home} />
          <Route path='/reports' component={Reports} />
          <Route path='/products' component={Products} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
